contract OreniumCoin is Context, IERC20, Ownable { 
    using SafeMath for uint256;
    using Address for address;

    mapping (address => uint256) private _tOwned;
    mapping (address => mapping (address => uint256)) private _allowances;
    mapping (address => bool) public checknofee_transfer; 

   
    address payable public Admin_Wallet = payable(0xACcF90d8714b4795F43b6a505E6031a6dC02A75C);
 
    string private _name = "Orenium Protocol"; 
    string private _symbol = "ORE";  
    uint8 private _decimals = 18;
    uint256 private _tTotal = 125000000 * 10**18;
    uint256 private _tFeeTotal;

    uint8 private txCount = 0;
    uint8 private swapTrigger = 2; 

    uint256 private maxPossibleFee = 30; 

    uint256 private _previousTotalFee = _TotalFee; 
    uint256 private _previousBuyFee = Ore_buy_fee; 
    uint256 private _previousSellFee = Ore_sell_fee; 

    uint256 private _TotalFee = 30;
    uint256 public Ore_buy_fee = 15;
    uint256 public Ore_sell_fee = 15;

    uint256 public _maxOreHold = _tTotal.mul(2).div(100);
    uint256 private _previousMaxWalletToken = _maxOreHold;


    uint256 public _maxTrx_ore = _tTotal.mul(2).div(100); 
    uint256 private _previousMaxTxAmount = _maxTrx_ore;

                                     
    IUniswapV2Router02 public uniswapV2Router;
    address public uniswapV2Pair;
    bool public inSwapAndLiquify;
    bool public swapAndLiquifyEnabled = true;
    
    event SwapAndLiquifyEnabledUpdated(bool enabled);
    event SwapAndLiquify(
        uint256 tokensSwapped,
        uint256 ethReceived,
        uint256 tokensIntoLiqudity
        
    );
    
    modifier lockTheSwap {
        inSwapAndLiquify = true;
        _;
        inSwapAndLiquify = false;
    }
    
    constructor () {
        _tOwned[owner()] = _tTotal;
        
        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(0x10ED43C718714eb63d5aA57B78B54704E256024E); 
        
        
        uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory())
            .createPair(address(this), _uniswapV2Router.WETH());
        uniswapV2Router = _uniswapV2Router;
        checknofee_transfer[owner()] = true;
        checknofee_transfer[address(this)] = true;
        checknofee_transfer[Admin_Wallet] = true;
        
        emit Transfer(address(0), owner(), _tTotal);
    }


    function name() public view returns (string memory) {
        return _name;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view override returns (uint256) {
        return _tTotal;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return _tOwned[account];
    }

    function transfer(address recipient, uint256 amount) public override returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function allowance(address owner, address spender) public view override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) public override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(sender, _msgSender(), _allowances[sender][_msgSender()].sub(amount, "ERC20: transfer amount exceeds allowance"));
        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue) public virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].add(addedValue));
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue) public virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].sub(subtractedValue, "ERC20: decreased allowance below zero"));
        return true;
    }

    
    function excludeTaxLimit(address account) public onlyOwner {
        checknofee_transfer[account] = true;
    }
    
    function includeInTaxLimit(address account) public onlyOwner {
        checknofee_transfer[account] = false;
    }
    

    function _ore_fee_settings(uint256 Ore_buy_update, uint256 Ore_sell_update) external onlyOwner() {

        require((Ore_buy_update + Ore_sell_update) <= maxPossibleFee, "Fee is too high!");
        Ore_sell_fee = Ore_sell_update;
        Ore_buy_fee = Ore_buy_update;

    }
    
    function set_Swap_And_Liquify_Enabled(bool true_or_false) public onlyOwner {
        swapAndLiquifyEnabled = true_or_false;
        emit SwapAndLiquifyEnabledUpdated(true_or_false);
    }

    function Admin_Update(address payable wallet) public onlyOwner() {
        Admin_Wallet = wallet;
        checknofee_transfer[Admin_Wallet] = true;
    }

    function set_Number_Of_Transactions_Before_Liquify_Trigger(uint8 number_of_transactions) public onlyOwner {
        swapTrigger = number_of_transactions;
    }
    
    receive() external payable {}


    bool public checkfeetransfer_ = false;

    function Transfers_tax_Update(bool true_or_false) external onlyOwner {
        checkfeetransfer_ = true_or_false;
    }

     function _maxOreHold_update(uint256 maxWallPercent_x100) external onlyOwner() {
        _maxOreHold = _tTotal*maxWallPercent_x100/10000;
    }

    function _maxTrx_ore_update(uint256 maxTxPercent_x100) external onlyOwner() {
        _maxTrx_ore = _tTotal*maxTxPercent_x100/10000;
    }    
    


    function removeAllFee() private {
        if(_TotalFee == 0 && Ore_buy_fee == 0 && Ore_sell_fee == 0) return;


        _previousBuyFee = Ore_buy_fee; 
        _previousSellFee = Ore_sell_fee; 
        _previousTotalFee = _TotalFee;
        Ore_buy_fee = 0;
        Ore_sell_fee = 0;
        _TotalFee = 0;

    }
    
    function restoreAllFee() private {
    
    _TotalFee = _previousTotalFee;
    Ore_buy_fee = _previousBuyFee; 
    Ore_sell_fee = _previousSellFee; 

    }

    function _approve(address owner, address spender, uint256 amount) private {

        require(owner != address(0) && spender != address(0), "ERR: zero address");
        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);

    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) private {
        
        
        if (to != owner() &&
            to != Admin_Wallet &&
            to != address(this) &&
            to != uniswapV2Pair &&
           
            from != owner()){
            uint256 heldTokens = balanceOf(to);
            require((heldTokens + amount) <= _maxOreHold,"You are trying to buy too many tokens. You have reached the limit for one wallet.");}

        if (from != owner() && to != owner())
            require(amount <= _maxTrx_ore, "You are trying to buy more than the max transaction limit.");



        if(
            txCount >= swapTrigger && 
            !inSwapAndLiquify &&
            from != uniswapV2Pair &&
            swapAndLiquifyEnabled 
            )
        {  
            
            txCount = 0;
            uint256 contractTokenBalance = balanceOf(address(this));
            if(contractTokenBalance > _maxTrx_ore) {contractTokenBalance = _maxTrx_ore;}
            if(contractTokenBalance > 0){
            swapAndLiquify(contractTokenBalance);
        }
        }


        
        bool takeFee = true;
         
        if(checknofee_transfer[from] || checknofee_transfer[to] || (checkfeetransfer_ && from != uniswapV2Pair && to != uniswapV2Pair)){
            takeFee = false;
        } else if (from == uniswapV2Pair){_TotalFee = Ore_buy_fee;} else if (to == uniswapV2Pair){_TotalFee = Ore_sell_fee;}
        
        _tokenTransfer(from,to,amount,takeFee);
    }

    function sendToWallet(address payable wallet, uint256 amount) private {
            wallet.transfer(amount);
        }


    function swapAndLiquify(uint256 contractTokenBalance) private lockTheSwap {
        
        swapTokensForBNB(contractTokenBalance);
        uint256 contractBNB = address(this).balance;
        sendToWallet(Admin_Wallet,contractBNB);
    }


    function process_Transaction (uint256 percent_Of_Tokens_To_Process) public onlyOwner {
        // Do not trigger if already in swap
        require(!inSwapAndLiquify, "Currently processing, try later."); 
        if (percent_Of_Tokens_To_Process > 100){percent_Of_Tokens_To_Process == 100;}
        uint256 tokensOnContract = balanceOf(address(this));
        uint256 sendTokens = tokensOnContract*percent_Of_Tokens_To_Process/100;
        swapAndLiquify(sendTokens);
    }


    function swapTokensForBNB(uint256 tokenAmount) private {

        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router.WETH();
        _approve(address(this), address(uniswapV2Router), tokenAmount);
        uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0, 
            path,
            address(this),
            block.timestamp
        );
    }



    function New_Router_and_Update_Pair(address newRouter) public onlyOwner() {
        IUniswapV2Router02 _newPCSRouter = IUniswapV2Router02(newRouter);
        uniswapV2Pair = IUniswapV2Factory(_newPCSRouter.factory()).createPair(address(this), _newPCSRouter.WETH());
        uniswapV2Router = _newPCSRouter;
    }
   
    function New_Router_Address(address newRouter) public onlyOwner() {
        IUniswapV2Router02 _newPCSRouter = IUniswapV2Router02(newRouter);
        uniswapV2Router = _newPCSRouter;
    }
    
    function New_Pair_Address(address newPair) public onlyOwner() {
        uniswapV2Pair = newPair;
    }


    function _tokenTransfer(address sender, address recipient, uint256 amount,bool takeFee) private {
        
        
        if(!takeFee){
            removeAllFee();
            } else {
                txCount++;
            }
            _transferTokens(sender, recipient, amount);
        
        if(!takeFee)
            restoreAllFee();
    }

    function _transferTokens(address sender, address recipient, uint256 tAmount) private {
        (uint256 tTransferAmount, uint256 tDev) = _getValues(tAmount);
        _tOwned[sender] = _tOwned[sender].sub(tAmount);
        _tOwned[recipient] = _tOwned[recipient].add(tTransferAmount);
        _tOwned[address(this)] = _tOwned[address(this)].add(tDev);   
        emit Transfer(sender, recipient, tTransferAmount);
    }

    function _getValues(uint256 tAmount) private view returns (uint256, uint256) {
        uint256 tDev = tAmount*_TotalFee/100;
        uint256 tTransferAmount = tAmount.sub(tDev);
        return (tTransferAmount, tDev);
    }

}

